import React, { useState } from 'react';
import PropTypes from 'prop-types';

const Textbox = ({}) => {
  const [language, setLanguage] = useState('C++');
  const [code, setCode] = useState('//Enter your C++ code here');
  const onChange = e => {
    setCode(e.target.value);
  };

  const getOutput = e => {
    console.log('Hello');
    axios
      .post('https://api.judge0.com/submissions', {
        source_code: code,
        language_id: 15
      })
      .then(f => {
        axios.get('https://api.judge0.com/submissions/${f.token}').then(d => {
          console.log(d);
        });
      });
  };
  return (
    <div>
      <form onSubmit={getOutput} className='form'>
        <textarea
          rows='4'
          cols='20'
          name='comment'
          form='usrform'
          placeholder='Enter your code here'
          className='#ffebee red lighten-5'
          style={{ height: '500px' }}
          value={code}
          onChange={onChange}
        />
        <input type='submit' value='Run' className='btn btn-dark btn-block' />
      </form>
    </div>
  );
};
Textbox.propTypes = {
  getOutput: PropTypes.func.isRequired
};

export default Textbox;
